--
-- Triggers `customer_feedback`
--
DELIMITER $$
CREATE TRIGGER `after_feedback_approved` AFTER UPDATE ON `customer_feedback` FOR EACH ROW BEGIN
    IF NEW.Status = 'Approved' AND OLD.Status != 'Approved' THEN
        UPDATE `customers` 
        SET `FeedbackCount` = `FeedbackCount` + 1
        WHERE `CustomerID` = NEW.CustomerID;
    ELSEIF OLD.Status = 'Approved' AND NEW.Status != 'Approved' THEN
        UPDATE `customers` 
        SET `FeedbackCount` = GREATEST(`FeedbackCount` - 1, 0)
        WHERE `CustomerID` = NEW.CustomerID;
    END IF;
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `update_satisfaction_from_feedback` AFTER UPDATE ON `customer_feedback` FOR EACH ROW BEGIN
    IF NEW.Status = 'Approved' THEN
        UPDATE customers 
        SET SatisfactionRating = (
            SELECT ROUND(AVG(OverallRating), 2)
            FROM customer_feedback
            WHERE CustomerID = NEW.CustomerID 
            AND Status = 'Approved'
        )
        WHERE CustomerID = NEW.CustomerID;
    END IF;
    
    IF OLD.Status = 'Approved' AND NEW.Status != 'Approved' THEN
        UPDATE customers 
        SET SatisfactionRating = (
            SELECT COALESCE(ROUND(AVG(OverallRating), 2), 0.00)
            FROM customer_feedback
            WHERE CustomerID = NEW.CustomerID 
            AND Status = 'Approved'
        )
        WHERE CustomerID = NEW.CustomerID;
    END IF;
END
$$
DELIMITER ;

